import logo from './logo.svg';
import './App.css';

const mydiv2 =() => {
    const myName="박준영";
    const myGit="https://github.com/parkjunyeongg";
    console.log(myName)
    return (
      <div>
        <p>Github : <a href={myGit}></a></p>
      </div>
    );


}

export default mydiv2;
